import { useEffect, useState } from 'react';
import Navbar from '../composants/Navbar';
import Paragraphe from '../composants/Paragraphe';
import ListePage from '../composants/ListePage';
import SideBar from '../composants/SideBar';
import Card from '../composants/Card';

function Cours() {
    return(
        <div className="container-fluid row column border">
            <div className=" column col-md-2 border">
                <SideBar></SideBar>
            </div>
            <div className='column col-md-10 border'>
                <Card></Card>
            </div>
        </div>   
    );
}

export default Cours;
